import React, { useEffect, useRef } from 'react'
import { useNavigate, useParams } from 'react-router-dom'
import EditNote from './editNote'
import Note from './Note'
function CardModal() {
  const navigate = useNavigate()
  const { id } = useParams()

  const onClose = (e) => {

    e.stopPropagation()

    navigate(-1)
  }


  if (!id) return null
  return (
    <div  onClick={onClose}>
      <span >hehe</span>
      <Note />
    </div>
  )
}

export default CardModal
